        GD.Print(inst.Foo); // Prints bar
    }
}

member.example:
This sample prints a message once every frame up to 100 times.

public override void _Ready()
{
    for (int i = 0; i < 100; i++)
    {
        await ToSignal(GetTree(), "process_frame");
        GD.Print($"Frame {i}");
    }
}

